import React from 'react'
import "./Modalito.css"

const Modalito = ({props}) => {
  return (
    <article className='modal is-open'>
      <div className='modal-container'>
        <button className='modal-close'>X</button>
        {props}
      </div>
    </article>
  )
}

export default Modalito
